import {NgModule} from '@angular/core';
import {RouterModule, Routes} from '@angular/router';
import {StudentListComponent} from "./student/student-list/student-list.component";
import {StudentEditComponent} from "./student/student-edit/student-edit.component";

const routes: Routes = [
  {path: ''},
  {
    path: 'student', component: StudentListComponent, children: [
      {path: ':id', component: StudentEditComponent},
      {path: '/new', component: StudentEditComponent},
      {path: '/id/edit', component: StudentEditComponent}
    ]
  },
  {
    path: 'subject', component: StudentListComponent, children: [
      {path: ':id', component: StudentEditComponent},
      {path: '/new', component: StudentEditComponent},
      {path: '/id/edit', component: StudentEditComponent}
    ]
  },
  {
    path: 'student', component: StudentListComponent, children: [
      {path: ':id', component: StudentEditComponent},
      {path: '/new', component: StudentEditComponent},
      {path: '/id/edit', component: StudentEditComponent}
    ]
  }
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule {
}
